import React from "react";
import Comic from "../../../assets/Comic.jpg";
import "./index.css";
const Landing = (props) => {
  return (
    <div className="landingWrapper">
      <div className="landingImgWrapper">
        <img className="landingImg" src={Comic} alt=""/>
      </div>
      <div className="landingInfo">
        <div className="landingHeading1">Welcome to LexiComicraft</div>
        <div className="landingHeading2">{props.heading2}</div>
      </div>
    </div>
  );
};

export default Landing;
